import React from "react";
import { HiShoppingCart } from "react-icons/hi";


function Navbar({TotalCountchange}){
  return ( 
    <div className='py-4 bg-white'>
      
    <div className='max-w-6xl flex justify-between items-centre mx-auto'>
    <img className="h-16" src="data:image/jpeg;base64,"/>

<div className="border border-red-300 bg-color-300 flex items-center justify-center">You will get the best Product here. </div>

<div className="text-grey-200 flex flex-col items-center" >

<HiShoppingCart className="text-4xl text-pink-300"/>
<span className="-m-9" >{TotalCountchange}</span>
</div>
    </div>
    
    </div>
    )
}

export default Navbar;
